import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { 
  getFishData, setFishData, 
  getBugData, setBugData, 
  getSeaCreaturesData, setSeaCreaturesData } from './app/fishData/dataSlice';
import { Header } from './components/Header/Header';
import { HomePage } from './HomePage';
import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";
import './App.css';

function App() {
    const fish = useSelector((state) => state.data.fish);
    const bugs = useSelector((state) => state.data.bugs);
    const seaCreatures = useSelector((state) => state.data.seaCreatures);
    const dispatch = useDispatch();

    useEffect(async() => {
      setTimeout(() => {
        dispatch(setFishData());
      }, 1000);
      dispatch(setBugData());
      dispatch(setSeaCreaturesData());
      console.log('fish: ', fish);
      console.log('bugs: ', bugs);
      console.log('sea creatures: ', seaCreatures);
    })

  return (
    <Router>
    <div className="App">
    <Header />
        <Route exact path="/" component={HomePage} />
    </div>
    </Router>
  );
}

export default App;
